import "./App.css";

const input = [1,2,3,4,5];
const size = 3;
const result = groupArrayElements(input, size);

function App() {
  const input = [1,2,3,4,5];
  var test=input.join().split(',')
  console.log(test)
  return (
    <div className="App">
      <pre>Input :{input.map(function(e){return e.toString()})}</pre>
      <pre>size :{JSON.stringify(size)} </pre>
      <pre>Output :{JSON.stringify(result)}</pre>
    </div>
  );
}
export default App;
